    [],nt"num_tags": 6,nt"name": "tule-lake-national-wildlife-refuge-narrative-report-september-through-december-1953",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Tule Lake National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1953. The report begins by summarizing the weather conditions, water conditions,
    food and cover, and wildfires during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, and
    raptors- is also covered. The Refuge development and maintenance section discusses
    physical developments and plantings. Resource management is outlined; topics include
    fur harvesting. A progress report on field investigations and applied research is
    included. The public relations section of the report describes Refuge visitors,
    Refuge participation, hunting, and violations. N-R forms, photographs, and narrative
    reports on Clear Lake National Wildlife Refuge, Upper Klamath National Wildlife
    Refuge, and Lower Klamath National Wildlife Refuge are attached.",nt"owner_org":
